import About from "../pages/About";
import Posts from "../pages/Posts";

export const routes = [
    {path: '/about', commponent: About, exact: true},
    {path: '/posts', commponent: Posts, exact: true},
    {path: '/posts/:id', commponent: About, exact: true}
]
